import React, { useContext } from 'react';
import styleForm from './FormComponent.module.css';
import axios from 'axios';
import { UserContext } from '../../../hooks/userContextApp';

const FormComponent = ({ handleChange, handleSubmit, formValid, closeForm }) => {
  const { userInformation } = useContext(UserContext);
  const token = localStorage.getItem('token');
  const addCard = async () => {
    try {
      const formData = new FormData();
      formData.append('title', formData.title);
      formData.append('subtitle', formData.subtitle);
      formData.append('description', formData.description);
      formData.append('phone', formData.phone);
      formData.append('email', formData.email);
      formData.append('web', formData.web);
      formData.append('image', await fetchImage(formData.imageUrl)); // Assuming fetchImage is a function that fetches the image and returns it

      const config = {
        method: 'post',
        url: 'https://monkfish-app-z9uza.ondigitalocean.app/bcard2/cards',
        headers: {
          'x-auth-token': token,
          'Content-Type': 'multipart/form-data',
        },
        data: formData,
      };

      const response = await axios(config);
      console.log('Card added successfully:', response.data);
    } catch (error) {
      console.error('Error adding card:', error);
    }
  };

  const fetchImage = async (imageUrl) => {
    try {
      const response = await axios.get(imageUrl, { responseType: 'blob' });
      return response.data;
    } catch (error) {
      console.error('Error fetching image:', error);
      throw error; // Rethrow the error to handle it in addCard function
    }
  };

  return (
    <div className={styleForm.container}>
      <div className={styleForm.containerForm}>
        <button className={styleForm.btn} onClick={closeForm}>
          X
        </button>
        <form className={styleForm.form} onSubmit={handleSubmit}>
          <div className={styleForm.section}>
            <label className={styleForm.label}>Title*:</label>
            <br />
            <input
              className={styleForm.input}
              type="text"
              name="title"
              required
              onChange={handleChange}
            />
            <label className={styleForm.label}>Subtitle*:</label>
            <br />
            <input
              className={styleForm.input}
              type="text"
              name="subtitle"
              required
              onChange={handleChange}
            />
          </div>
          <label>Description*:</label>

          <input
            className={styleForm.input}
            type="text"
            name="description"
            required
            onChange={handleChange}
          />
          <hr />
          <div className={styleForm.section}>
            <label className={styleForm.label}>Phone*:</label>
            <input
              className={styleForm.input}
              type="tel"
              name="phone"
              required
              onChange={handleChange}
            />
            <label className={styleForm.label}>Email*:</label>
            <input
              className={styleForm.input}
              type="email"
              name="email"
              required
              onChange={handleChange}
            />
          </div>
          <label>
            Web (URL for the website):
          </label>

          <input
            className={styleForm.input}
            type="url"
            name="web"
            onChange={handleChange}
          />
          <hr />
          <div className={styleForm.section}>
            <label className={styleForm.label}>Image URL:</label>
            <input
              className={styleForm.input}
              type="url"
              name="imageUrl"
              onChange={handleChange}
            />
            <label className={styleForm.label}>Image Alt:</label>
            <input
              className={styleForm.input}
              type="text"
              name="imageAlt"
              onChange={handleChange}
            />
          </div>
          <hr />
          <div className={styleForm.section}>
            <label>City*:</label>
            <input
              className={styleForm.input}
              type="text"
              name="city"
              required
              onChange={handleChange}
            />
            <hr />
            <label>Country*:</label>
            <input
              className={styleForm.input}
              type="text"
              name="country"
              required
              onChange={handleChange}
            />
          </div>
          <label>State:</label>
          <input
            className={styleForm.input}
            type="text"
            name="state"
            onChange={handleChange}
          />
          <hr />
          <div className={styleForm.section}>
            <label>Street*:</label>
            <input
              className={styleForm.input}
              type="text"
              name="street"
              required
              onChange={handleChange}
            />
            <label>House Number*:</label>
            <input
              className={styleForm.input}
              type="text"
              name="houseNumber"
              required
              onChange={handleChange}
            />
          </div>
          <label>Zip*:</label>
          <input
            className={styleForm.input}
            type="text"
            name="zip"
            required
            onChange={handleChange}
          />
          <hr />
          <button
            onClick={addCard}
            type="button" // Changed to type="button" to prevent form submission
            disabled={!formValid}
            style={{ cursor: formValid ? 'pointer' : 'not-allowed' }}
          >
            Send
          </button>
        </form>
      </div>
    </div>
  );
};

export default FormComponent;
